'use strict';
class OffersBidAskCalculated {
    bid;
    ask;
    static create(bid, ask) {
        let result;
        result = new OffersBidAskCalculated();
        result.bid = bid;
        result.ask = ask;
        return result;
    }
    getBid() {
        return this.bid;
    }
    getAsk() {
        return this.ask;
    }
}
module.exports = OffersBidAskCalculated
